import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';
import Homepage from './pages/Homepage';
import AboutUs from './pages/AboutUs';
import ProductsCenter from './pages/ProductsCenter';
import NewsActivities from './pages/NewsActivities';
import SocialResponsibility from './pages/SocialResponsibility';
import ContactUs from './pages/ContactUs';
import JoinUs from './pages/JoinUs';

function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
         <Route path="/" element={<Homepage />} />
         <Route path="/about" element={<AboutUs />} />
         <Route path="/products" element={<ProductsCenter />} />
         <Route path="/news" element={<NewsActivities />} />
         <Route path="/social" element={<SocialResponsibility />} />
         <Route path="/contact" element={<ContactUs />} />
         <Route path="/join" element={<JoinUs />} />
      </Routes>
    </Router>
  );
}

export default App;
